function getImage(ch)
{
    var dir = "img/";
    var img = {
        outer   : "outer.png",
        wall    : "wall.jpg",
        floor   : "floor.jpg",
        target  : "target.jpg",
        box     : "box.jpg",
        hit     : "hit.jpg",
        pusher  : "pusher.jpg",
        pit     : "pit.jpg"
    };
    return dir+img[ch];
}
function mapConvert(n)
{
    var index = {
        1 : "outer",
        2 : "wall",
        3 : "floor",
        4 : "target",
        5 : "box",
        6 : "hit",      //box in target
        7 : "pit",      //person in target
        9 : "pusher"    //person in floor
    }
    return index[n];
}
